            "title": {
                "text": "Воронежский завод японской Furukawa Electric смог вдвое сократить убытки в 2021 году",
                "markup": "<?xml version=\"1.0\" encoding=\"utf-8\"?><scandoc><sentence><entity type=\"theme\" local-id=\"9\">Воронежский завод японской <entity type=\"company\" local-id=\"2\">Furukawa Electric </entity>смог вдвое сократить убытки в 2021 году\r\n&lt;data&gt;\r\n&lt;body&gt;&lt;div itemprop=\"articleBody\"&gt;\r\n        \r\n    \r\n&lt;p&gt;</entity></sentence></scandoc>"
            },
            "content": {
                "markup": "<?xml version=\"1.0\" encoding=\"utf-8\"?><scandoc><sentence><entity type=\"theme\" local-id=\"6\">По итогам 2021 года расположенный в <entity type=\"company\" local-id=\"0\">воронежском индустриальном парке \"Масловский\" </entity><entity type=\"company\" local-id=\"1\"><entity type=\"company\" local-id=\"4\">завод волоконно-оптического кабеля связи АО \"ОФС РУСС ВОКК\" </entity></entity>получил 49,85 млн руб. убытков. </entity></sentence><sentence><entity type=\"theme\" local-id=\"8\"><entity type=\"company\" local-id=\"2\"><entity type=\"company\" local-id=\"5\">Российское предприятие японского концерна Furukawa Electric </entity></entity>смогло за прошлый год сократить убытки на 83%. </entity></sentence><sentence>По итогам 2020-го они составляли 296,75 млн руб. </sentence><sentence>Об этом сообщается в бухгалтерской отчетности <entity type=\"company\" local-id=\"2\"><entity type=\"company\" local-id=\"5\">компании </entity></entity>по РСБУ, опубликованной в базе <entity type=\"company\" local-id=\"3\">\"СПАРК-Интерфакс\"</entity>. </sentence><sentence>Выручка <entity type=\"company\" local-id=\"2\"><entity type=\"company\" local-id=\"5\">предприятия </entity></entity>без учета НДС в 2021 году составила 2,1 млрд руб., что на 12% больше показателя 2020-го в 1,87 млрд руб. </sentence><sentence><entity type=\"theme\" local-id=\"10\">Размер чистых активов <entity type=\"company\" local-id=\"2\"><entity type=\"company\" local-id=\"5\">компании </entity></entity>остался отрицательным и сократился еще на 7%.&lt;/p&gt;\r\n\r\n&lt;p&gt;</entity></sentence><sentence>Он составил 718,39 млн руб. со знаком \"минус\" (- 668,54 млн руб. годом ранее). </sentence><sentence>Денежный поток <entity type=\"company\" local-id=\"1\">АО \"ОФС РУСС ВОКК\" </entity>в 2021 году, напротив, стал положительным и составил 2,8 млн руб. (- 115,49 млн руб. годом ранее). &lt;/p&gt;\r\n\r\n\r\n&lt;/div&gt;&lt;/body&gt;\r\n&lt;/data&gt;\r\n\r\n</sentence></scandoc>"
            },
